impl Solution {
    pub fn find_minimum_operations(s1: String, s2: String, s3: String) -> i32 {
        // Convert strings to character vectors for easier manipulation
        let s1 = s1.chars().collect::<Vec<_>>();
        let s2 = s2.chars().collect::<Vec<_>>();
        let s3 = s3.chars().collect::<Vec<_>>();

        // Calculate the lengths of the strings
        let len1 = s1.len();
        let len2 = s2.len();
        let len3 = s3.len();

        // Initialize the number of operations to 0
        let mut operations = 0;

        // Find the smallest length among the three strings
        let mut i = 0;
        while i < len1 && i < len2 && i < len3 {
            if s1[i] == s2[i] && s2[i] == s3[i] {
                i += 1;
            } else {
                break;
            }
        }

        // The number of operations required is the sum of the differences
        // between the lengths of the strings and the length of their common prefix
        operations = (len1 - i) + (len2 - i) + (len3 - i);

        // If there's no common prefix, and the strings are different from the start,
        // it's impossible to make them equal by deletion.
        if i == 0 && (len1 > 0 && len2 > 0 && len3 > 0) && (s1[0] != s2[0] || s2[0] != s3[0] || s1[0] != s3[0]) {
            return -1;
        }

        operations as i32
    }
}
